using OmiGames.Numerics.Fixed;
using System.Security;
using Unity.Burst;
using Unity.Entities;
using UnityEngine;

[UpdateInGroup(typeof(FixedSimulationGroup))]
partial struct UnitMovementSystem : ISystem {

    Fixed64 fixedDeltaTime;
    Fixed64 lastTimeStep;

    [BurstCompile]
    public void OnCreate(ref SystemState state) {
        fixedDeltaTime = new Fixed64(0.0625);
    }

    [BurstCompile]
    public void OnUpdate(ref SystemState state) {

        // Enforce fixed update
        if (SystemAPI.Time.ElapsedTime < (lastTimeStep + fixedDeltaTime).ToDouble()) return;
        lastTimeStep = (Fixed64)SystemAPI.Time.ElapsedTime;

        foreach (var (
        movementData,
        orderData,
        fixedSimTransform)
        in SystemAPI.Query<
            RefRO<UnitMovementData>,
            RefRO<UnitOrderData>,
            RefRW<FixedSimulationTransform>>()) {

            var currentMoveSpeed = fixedSimTransform.ValueRO.MoveSpeed;

            // Movement acceleration
            var maxMoveSpeed = movementData.ValueRO.moveMaxSpeed; // Max speed (fixed value)
            var moveAcceleration = movementData.ValueRO.moveAcceleration; // How fast to accelerate

            // Calculate distance to target position
            //FVector2 targetPosition = new (CursorWorldPosition.Last.x, CursorWorldPosition.Last.z); <= This code works.
            FVector2 targetPosition = orderData.ValueRO.targetPosition;

            if (targetPosition == FVector2.Zero) // TODO: WHY?
                return;

            FVector2 moveDelta = targetPosition - fixedSimTransform.ValueRO.Position;
            FVector2 moveDirection = moveDelta.normalized;
            Fixed64 distance = moveDelta.magnitude;
            Fixed64 stopDistance = movementData.ValueRO.moveStopDistance;

            // MOVE SPEED
            if (currentMoveSpeed < maxMoveSpeed) {
                currentMoveSpeed += moveAcceleration * fixedDeltaTime;
            }
            if (distance > stopDistance) {
                currentMoveSpeed = FixedMath.Max(currentMoveSpeed, maxMoveSpeed);
            } else {
                currentMoveSpeed = FixedMath.Clamp(currentMoveSpeed, maxMoveSpeed * (Fixed64)0.1, maxMoveSpeed * distance / stopDistance);
            }


            // ROTATION

            var targetRot = FixedMath.Atan2(moveDirection.X, moveDirection.Y, AngleUnit.Radians);
            if (targetRot < Fixed64.Zero)
                targetRot += FixedMath.TwoPI;

            var currentRot = fixedSimTransform.ValueRO.Angle;
            var deltaRot = FixedMath.Repeat(targetRot - currentRot + FixedMath.PI, FixedMath.TwoPI) - FixedMath.PI;
            var absDeltaRot = FixedMath.Abs(deltaRot);

            // Apply easing only if below the threshold
            var easeFactor = Fixed64.One;
            if (absDeltaRot < movementData.ValueRO.rotationEasingThreshold) {
                easeFactor = absDeltaRot / movementData.ValueRO.rotationEasingThreshold; // Scales from 1 down to 0
                easeFactor = FixedMath.Clamp(easeFactor, new Fixed64(0.0625), Fixed64.One); // Min 1/16 speed
            }

            // Compute final rotation step
            var step = FixedMath.Sign(deltaRot) * FixedMath.Min(movementData.ValueRO.rotationMaxSpeed * easeFactor * fixedDeltaTime, absDeltaRot);

            // Apply rotation
            fixedSimTransform.ValueRW.Angle = currentRot + step;


            // POSITION

            fixedSimTransform.ValueRW.MoveSpeed = currentMoveSpeed;

            switch (movementData.ValueRO.movementStyle) {
                case UnitMovementStyle.Omni:
                    fixedSimTransform.ValueRW.Position += moveDirection * currentMoveSpeed * fixedDeltaTime;
                    break;

                case UnitMovementStyle.Wheeled:
                    fixedSimTransform.ValueRW.Position += fixedSimTransform.ValueRO.Forward * currentMoveSpeed * fixedDeltaTime;
                    break;
            }
        }
    }
}

class ScriptLoader {
	
	constructor(jsonPath) {
		this.jsonPath = jsonPath;
		this.scripts = [];
	}

	// Load JSON file containing script paths
	async loadJSON() {
		try {
			const response = await fetch(this.jsonPath);
			if (!response.ok) {
				throw new Error(`Failed to load JSON: ${response.statusText}`);
			}
			this.scripts = await response.json();

			// Debugging: Log loaded JSON data
			console.log("Loaded JSON scripts:", this.scripts);
		} catch (error) {
			console.error("Error loading JSON:", error);
		}
	}

	// Load scripts sequentially to ensure order
	async loadScriptsSequentially(callback) {
		if (!this.scripts.length) {
			console.warn("No scripts to load.");
			if (typeof callback === "function") callback();
			return;
		}

		let loadedScripts = 0;
		let failedScripts = 0;

		for (const scriptName of this.scripts) {
			const scriptPath = `http://${window.location.hostname}/jpsys/Shared/scripts/js/${scriptName}.js`.replace(/ /g, '%20');
			
			try {
				await this.loadSingleScript(scriptPath);
				loadedScripts++;
			} catch {
				failedScripts++;
			}
		}

		console.log(`Script loading completed. Success: ${loadedScripts}, Failed: ${failedScripts}`);

		if (typeof callback === "function") callback();
	}

	// Load a single script with error handling
	loadSingleScript(scriptPath) {
		return new Promise((resolve, reject) => {
			const script = document.createElement("script");
			script.src = scriptPath;
			script.defer = true;
			script.onload = () => {
				console.log(`Successfully loaded: "${scriptPath}"`);
				resolve();
			};
			script.onerror = () => {
				console.error(`Failed to load: "${scriptPath}"`);
				reject();
			};
			document.head.appendChild(script);
		});
	}

	// Main function to initialize script loading
	async init(callback) {
		await this.loadJSON();
		await this.loadScriptsSequentially(callback);
	}
}

// Usage example
const scriptLoader = new ScriptLoader(`http://${window.location.hostname}/jpsys/Shared/scripts/json/Scripts.json`);

scriptLoader.init(() => {
	console.log("All scripts processed.");
});
